import React from "react";
import '../cssFile/NavBarList.css'
import {Animated} from "react-animated-css";

export default function NavBarList(props) {
  return (
<Animated animationIn="rubberBand" animationOut="fadeOutDownBig" animationInDuration={1400} animationOutDuration={1400} isVisible={props.ShowHide}>
<ul className="list-group">
 <li onClick={props.a} className="list-group-item">My Profile</li>
 <li onClick={props.b} className="list-group-item">Contact Us</li>
 <li onClick={props.c} className="list-group-item">Log Out</li>
</ul>
</Animated>
  );
}
